import React from 'react';
import {
    BrowserRouter as Router,
    Route, Link, Redirect, withRouter
  } from 'react-router-dom';

  const Who = () => (
    <div> <h2>BLABLA BLAALAALA</h2> </div>
  )

  const Goals = () => (
    <div> <h2>jawikk</h2> </div>
  )

  const Journey = () => (
    <div> <h2>miu</h2> </div>
  )

  const Todo = () => (
    <div> <h2>Blololool</h2> </div>
  )

  const App = () => {

    const padding = { padding: 5 }

    return (
      <div>
        <Router>
          <div>
            <div>
              <Link style={padding} to="/">Who?</Link>
              <Link style={padding} to="/goals">Goals</Link>
              <Link style={padding} to="/journey">Journey</Link>
              <Link style={padding} to="/todo">TODO</Link>
            </div>
            <Route exact path="/" render={() => <Who />} />
            <Route path="/goals" render={() => <Goals />} />
            <Route path="/journey" render={() => <Journey />} />
            <Route path="/todo" render={() => <Todo />} />
          </div>
        </Router>
      </div>
    )
  }

export default App;
